DROP TABLE IF EXISTS account;

CREATE TABLE `account` (
  `ac_id` int(10) NOT NULL AUTO_INCREMENT,
  `b_id` int(11) NOT NULL,
  `ac_branch` text NOT NULL,
  `ac_name` varchar(30) NOT NULL,
  `ac_no` varchar(30) NOT NULL,
  PRIMARY KEY (`ac_id`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf32;




DROP TABLE IF EXISTS bank;

CREATE TABLE `bank` (
  `b_id` int(10) NOT NULL AUTO_INCREMENT,
  `b_name` varchar(30) CHARACTER SET utf32 NOT NULL,
  `b_address` text CHARACTER SET utf32,
  PRIMARY KEY (`b_id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS bill;

CREATE TABLE `bill` (
  `bill_id` int(11) NOT NULL AUTO_INCREMENT,
  `bill_code` varchar(15) NOT NULL,
  `fiscal_year` varchar(10) CHARACTER SET utf32 NOT NULL,
  `v_reg_no` varchar(100) CHARACTER SET utf32 NOT NULL,
  `reg_date` date NOT NULL,
  `expired_date` date NOT NULL,
  `reg_fee` int(11) NOT NULL,
  `arrear` int(11) NOT NULL,
  `sur_charge` int(11) NOT NULL,
  `total` double NOT NULL,
  `due` double NOT NULL,
  `fine` int(11) NOT NULL,
  `status` int(11) NOT NULL,
  `payment_date` date DEFAULT NULL,
  `entry_date` date DEFAULT NULL,
  `b_id` int(11) DEFAULT NULL,
  `ac_id` int(11) DEFAULT NULL,
  PRIMARY KEY (`bill_id`),
  UNIQUE KEY `bill_code` (`bill_code`)
) ENGINE=InnoDB AUTO_INCREMENT=1437 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS bill_issue_date;

CREATE TABLE `bill_issue_date` (
  `id` int(11) NOT NULL,
  `issue_date` date NOT NULL,
  `entry_date` date DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;




DROP TABLE IF EXISTS card_fee;

CREATE TABLE `card_fee` (
  `card_fee` int(11) NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf32;




DROP TABLE IF EXISTS checker;

CREATE TABLE `checker` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `pin` varchar(10) CHARACTER SET utf32 NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS driver;

CREATE TABLE `driver` (
  `d_id` int(11) NOT NULL AUTO_INCREMENT,
  `d_code` varchar(20) NOT NULL,
  `d_name` varchar(30) CHARACTER SET utf32 NOT NULL,
  `d_name_eng` varchar(45) DEFAULT NULL,
  `d_father_name` varchar(30) CHARACTER SET utf32 NOT NULL,
  `d_mother_name` varchar(30) CHARACTER SET utf32 NOT NULL,
  `d_dob` date DEFAULT NULL,
  `d_nid` varchar(30) CHARACTER SET utf32 NOT NULL,
  `d_holding_no` varchar(10) CHARACTER SET utf32 DEFAULT NULL,
  `d_mobile` varchar(15) CHARACTER SET utf32 NOT NULL,
  `d_license_no` varchar(50) CHARACTER SET utf32 NOT NULL,
  `o_id` int(11) NOT NULL,
  `v_id` int(11) NOT NULL,
  `p_division` int(11) DEFAULT NULL,
  `p_sub_division` int(11) DEFAULT NULL,
  `p_ward_no` int(11) DEFAULT NULL,
  `p_vill` int(11) DEFAULT NULL,
  `c_division` int(11) NOT NULL,
  `c_sub_division` int(11) NOT NULL,
  `c_ward_no` int(11) NOT NULL,
  `c_vill` int(11) NOT NULL,
  `d_photo_path` text CHARACTER SET utf32 NOT NULL,
  `d_blood_group` varchar(5) CHARACTER SET utf32 DEFAULT NULL,
  `same_adderss` varchar(45) DEFAULT NULL,
  `PermanentAddress` text CHARACTER SET utf32,
  `approve_date` date DEFAULT NULL,
  `entry_date` date NOT NULL,
  PRIMARY KEY (`d_id`),
  UNIQUE KEY `d_code` (`d_code`)
) ENGINE=InnoDB AUTO_INCREMENT=12 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS driver_card;

CREATE TABLE `driver_card` (
  `d_card_id` int(11) NOT NULL AUTO_INCREMENT,
  `cbl_code` varchar(15) DEFAULT 'NULL',
  `d_id` int(30) NOT NULL,
  `bill_type` int(11) NOT NULL DEFAULT '0',
  `card_fee` int(11) NOT NULL,
  `card_year` int(11) NOT NULL DEFAULT '3',
  `status` int(11) NOT NULL,
  `entry_date` date NOT NULL,
  `b_id` int(11) DEFAULT NULL,
  `ac_id` int(11) DEFAULT NULL,
  `payment_date` date DEFAULT NULL,
  PRIMARY KEY (`d_card_id`)
) ENGINE=InnoDB AUTO_INCREMENT=10 DEFAULT CHARSET=utf32;




DROP TABLE IF EXISTS driver_reg_fee;

CREATE TABLE `driver_reg_fee` (
  `driver_reg_fee` int(11) NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;




DROP TABLE IF EXISTS fiscal_year;

CREATE TABLE `fiscal_year` (
  `start_year` varchar(4) CHARACTER SET utf32 NOT NULL,
  `end_year` varchar(4) CHARACTER SET utf32 NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS issue_license;

CREATE TABLE `issue_license` (
  `issue_id` int(11) NOT NULL AUTO_INCREMENT,
  `issue_code` varchar(20) DEFAULT NULL,
  `issue_licenseNo` varchar(30) DEFAULT NULL,
  `issue_date` date DEFAULT NULL,
  `issue_start_year` int(11) DEFAULT NULL,
  `issue_end_year` int(11) DEFAULT NULL,
  `o_id` int(11) DEFAULT NULL,
  `v_id` int(11) DEFAULT NULL,
  `d_id` int(11) DEFAULT NULL,
  `entry_date` datetime DEFAULT NULL,
  PRIMARY KEY (`issue_id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS module;

CREATE TABLE `module` (
  `child_module_id` int(3) NOT NULL AUTO_INCREMENT,
  `parent_module_id` int(11) NOT NULL,
  `child_module` varchar(30) CHARACTER SET utf32 NOT NULL,
  PRIMARY KEY (`child_module_id`)
) ENGINE=InnoDB AUTO_INCREMENT=24 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS municipality;

CREATE TABLE `municipality` (
  `m_name` varchar(100) NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf32;




DROP TABLE IF EXISTS owner;

CREATE TABLE `owner` (
  `o_id` int(11) NOT NULL AUTO_INCREMENT,
  `o_code` varchar(15) DEFAULT NULL,
  `o_name` varchar(30) CHARACTER SET utf32 DEFAULT NULL,
  `owner_name_eng` varchar(100) DEFAULT NULL,
  `o_father_name` varchar(30) CHARACTER SET utf32 DEFAULT NULL,
  `o_mother_name` varchar(30) CHARACTER SET utf32 DEFAULT NULL,
  `o_dob` date NOT NULL,
  `o_nid` varchar(30) CHARACTER SET utf32 DEFAULT NULL,
  `o_holding_no` varchar(10) CHARACTER SET utf32 DEFAULT NULL,
  `o_mobile` varchar(15) CHARACTER SET utf32 DEFAULT NULL,
  `p_division` int(11) NOT NULL,
  `p_sub_division` int(11) NOT NULL,
  `p_ward_no` int(11) NOT NULL,
  `p_vill` int(11) NOT NULL,
  `c_division` int(11) NOT NULL,
  `c_sub_division` int(11) NOT NULL,
  `c_ward_no` int(11) NOT NULL,
  `c_vill` int(11) NOT NULL,
  `o_photo_path` text CHARACTER SET utf32,
  `entry_date` datetime DEFAULT NULL,
  `o_blood_group` varchar(5) CHARACTER SET utf32 DEFAULT NULL,
  `PermanentAddress` text CHARACTER SET utf32,
  `same_adderss` int(11) DEFAULT NULL,
  PRIMARY KEY (`o_id`),
  UNIQUE KEY `o_code` (`o_code`)
) ENGINE=InnoDB AUTO_INCREMENT=1408 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS owner_card_bill;

CREATE TABLE `owner_card_bill` (
  `o_cbill_id` int(11) NOT NULL AUTO_INCREMENT,
  `v_code` varchar(45) DEFAULT NULL,
  `ocbl_code` varchar(15) DEFAULT NULL,
  `o_id` int(11) NOT NULL,
  `bill_type` int(11) NOT NULL DEFAULT '0',
  `o_card_fee` int(11) NOT NULL,
  `status` int(11) NOT NULL,
  `entry_date` date NOT NULL,
  `b_id` int(11) DEFAULT NULL,
  `ac_id` int(11) DEFAULT NULL,
  `payment_date` date DEFAULT NULL,
  PRIMARY KEY (`o_cbill_id`)
) ENGINE=InnoDB AUTO_INCREMENT=16 DEFAULT CHARSET=utf32;




DROP TABLE IF EXISTS owner_card_fee;

CREATE TABLE `owner_card_fee` (
  `owner_card_fee` int(11) NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf32;




DROP TABLE IF EXISTS owner_transfer;

CREATE TABLE `owner_transfer` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `otbl_code` varchar(15) CHARACTER SET utf8 DEFAULT NULL,
  `reg_no` varchar(30) CHARACTER SET utf32 NOT NULL,
  `current_owner` int(11) NOT NULL,
  `previous_owner` int(11) NOT NULL,
  `o_transfer_date` date NOT NULL,
  `owner_transfer_fee` int(11) NOT NULL,
  `status` int(15) NOT NULL,
  `entry_date` date NOT NULL,
  `b_id` int(11) DEFAULT NULL,
  `ac_id` int(11) DEFAULT NULL,
  `payment_date` date DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `otbl_code` (`otbl_code`)
) ENGINE=InnoDB AUTO_INCREMENT=43 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS owner_transfer_fee;

CREATE TABLE `owner_transfer_fee` (
  `owner_transfer_fee` int(11) NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf32;




DROP TABLE IF EXISTS parent_module;

CREATE TABLE `parent_module` (
  `parent_module_id` int(11) NOT NULL AUTO_INCREMENT,
  `parent_module` varchar(100) CHARACTER SET utf32 NOT NULL,
  PRIMARY KEY (`parent_module_id`)
) ENGINE=InnoDB AUTO_INCREMENT=11 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS qrcode;

CREATE TABLE `qrcode` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `url` text NOT NULL,
  `regno` varchar(50) NOT NULL,
  `code` text NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS reg_check;

CREATE TABLE `reg_check` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `v_code` varchar(30) NOT NULL,
  `token` varchar(30) NOT NULL,
  `date` datetime NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS reg_fee;

CREATE TABLE `reg_fee` (
  `reg_fee` int(11) NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS settings_area;

CREATE TABLE `settings_area` (
  `area_id` int(11) NOT NULL AUTO_INCREMENT,
  `area` varchar(100) CHARACTER SET utf32 NOT NULL,
  `division_id` int(11) NOT NULL,
  `sub_division_id` int(11) NOT NULL,
  `ward_no_id` int(11) NOT NULL,
  PRIMARY KEY (`area_id`)
) ENGINE=InnoDB AUTO_INCREMENT=276 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS settings_division;

CREATE TABLE `settings_division` (
  `division_id` int(11) NOT NULL AUTO_INCREMENT,
  `division` varchar(100) CHARACTER SET utf32 NOT NULL,
  PRIMARY KEY (`division_id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS settings_sub_division;

CREATE TABLE `settings_sub_division` (
  `sub_division_id` int(11) NOT NULL AUTO_INCREMENT,
  `sub_division` varchar(100) CHARACTER SET utf32 NOT NULL,
  `division_id` int(11) NOT NULL,
  PRIMARY KEY (`sub_division_id`)
) ENGINE=InnoDB AUTO_INCREMENT=23 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS settings_ward_no;

CREATE TABLE `settings_ward_no` (
  `ward_no_id` int(11) NOT NULL AUTO_INCREMENT,
  `ward_no` varchar(100) CHARACTER SET utf32 NOT NULL,
  `division_id` int(11) NOT NULL,
  `sub_division_id` int(11) NOT NULL,
  PRIMARY KEY (`ward_no_id`)
) ENGINE=InnoDB AUTO_INCREMENT=86 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS sur_charge;

CREATE TABLE `sur_charge` (
  `sur_charge` int(11) NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS sys_code;

CREATE TABLE `sys_code` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `DOC_TYPE` varchar(5) NOT NULL,
  `DOC_NO` int(11) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=10 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS user;

CREATE TABLE `user` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user_name` varchar(30) CHARACTER SET utf32 DEFAULT NULL,
  `user_id` varchar(30) CHARACTER SET utf32 DEFAULT NULL,
  `user_password` varchar(30) CHARACTER SET utf32 DEFAULT NULL,
  `user_type_id` int(11) NOT NULL,
  `active` int(11) DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=9 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS user_access;

CREATE TABLE `user_access` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` varchar(30) CHARACTER SET utf32 DEFAULT NULL,
  `user_type_id` int(11) DEFAULT NULL,
  `module_name` varchar(100) CHARACTER SET utf32 DEFAULT NULL,
  `save` int(1) NOT NULL DEFAULT '0',
  `edit` int(1) NOT NULL DEFAULT '0',
  `remove` int(1) NOT NULL DEFAULT '0',
  `view` int(1) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS user_access_child;

CREATE TABLE `user_access_child` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` varchar(20) CHARACTER SET utf32 NOT NULL,
  `access_child` longtext CHARACTER SET utf32 NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS user_access_parent;

CREATE TABLE `user_access_parent` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` varchar(20) CHARACTER SET utf32 NOT NULL,
  `access_parent` text CHARACTER SET utf32 NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=9 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS user_type;

CREATE TABLE `user_type` (
  `user_type_id` int(11) NOT NULL AUTO_INCREMENT,
  `user_type_name` varchar(50) CHARACTER SET utf32 NOT NULL,
  PRIMARY KEY (`user_type_id`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS vehicle;

CREATE TABLE `vehicle` (
  `v_id` int(11) NOT NULL AUTO_INCREMENT,
  `v_code` varchar(30) NOT NULL,
  `o_id` int(11) NOT NULL,
  `v_model` varchar(30) CHARACTER SET utf32 DEFAULT NULL,
  `v_color` varchar(20) CHARACTER SET utf32 DEFAULT NULL,
  `chassis_no` varchar(45) DEFAULT NULL,
  `v_reg_no` varchar(30) CHARACTER SET utf32 DEFAULT NULL,
  `v_reg_date` date DEFAULT NULL,
  `v_detail` text CHARACTER SET utf32,
  `entry_date` date DEFAULT NULL,
  `update_date` date NOT NULL,
  PRIMARY KEY (`v_id`),
  UNIQUE KEY `v_code` (`v_code`),
  KEY `o_id` (`o_id`)
) ENGINE=InnoDB AUTO_INCREMENT=1445 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS vehicle_card_issue;

CREATE TABLE `vehicle_card_issue` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `v_code` varchar(45) NOT NULL,
  `issue_date` date NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=latin1;




